import { Button, StyleSheet, Text, View, TextInput } from 'react-native';

function Menu(params) {
    return (
    <View style={styles.Menu}>
        <Button onPress={() => params.addClient()} title="Add Client"></Button>
        <Button onPress={() => params.viewClients()} title="View Clients"></Button>
    </View>

    )
}

export default Menu;

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    input: {
      height: 40,
      margin: 12,
      borderWidth: 1,
      padding: 10,
    },
  });
